""" 
selfcontained_sign_tool.py
Self-contained single-file Sign Capture / Train / Recognize app.
All data (samples, previews, model, labels) are embedded inside this file in JSON form.
When you capture or train, the script rewrites itself to embed new data.

Run:
    python selfcontained_sign_tool.py

Dependencies:
    pip install opencv-python mediapipe numpy scikit-learn joblib
Optional (better thumbnails):
    pip install pillow

CAUTION:
 - The file will grow as you add data or train a model.
 - Keep backups of this .py if you care about preserving older versions.
"""

