# configuration
DEFAULT_SAMPLES = 20
FRAMES_PER_SAMPLE = 8
FRAME_WAIT_MS = 40
FRAMES_WINDOW = FRAMES_PER_SAMPLE

mp_hands = mp.solutions.hands
mp_drawing = mp.solutions.drawing_utils

ANGLE_TRIPLETS = [
    (1,2,3), (2,3,4),
    (0,5,6), (5,6,7), (6,7,8),
    (0,9,10), (9,10,11), (10,11,12),
    (0,13,14), (13,14,15), (14,15,16),
    (0,17,18), (17,18,19), (18,19,20)
]

def angle_between(a, b, c):
    v1 = a - b
    v2 = c - b
    n1 = np.linalg.norm(v1); n2 = np.linalg.norm(v2)
    if n1 <= 1e-9 or n2 <= 1e-9:
        return 0.0
    cosang = np.dot(v1, v2) / (n1 * n2)
    cosang = float(np.clip(cosang, -1.0, 1.0))
    return math.degrees(math.acos(cosang))

def compute_frame_features(lm_xyz, img_w, img_h):
    pts = np.zeros((21,3), dtype=np.float32)
    pts[:,0] = lm_xyz[:,0] * img_w
    pts[:,1] = lm_xyz[:,1] * img_h
    pts[:,2] = lm_xyz[:,2] * img_w
    wrist = pts[0]
    hand_size = np.linalg.norm(pts[9] - wrist)
    if hand_size <= 1e-6:
        hand_size = 1.0
    norm_coords = (pts - wrist) / hand_size
    norm_flat = norm_coords.flatten()
    dists = []
    for i in range(21):
        for j in range(i+1, 21):
            dists.append(np.linalg.norm(pts[i,:2] - pts[j,:2]) / hand_size)
    dists = np.array(dists, dtype=np.float32)
    angs = [angle_between(pts[a], pts[b], pts[c]) for a,b,c in ANGLE_TRIPLETS]
    angs = np.array(angs, dtype=np.float32)
    try:
        hull = cv2.convexHull(pts[:,:2].astype(np.int32))
        hull_area = float(cv2.contourArea(hull))
    except Exception:
        hull_area = 0.0
    hull_area_norm = hull_area / (img_w * img_h)
    bbox = np.array([np.min(pts[:,0])/img_w, np.min(pts[:,1])/img_h, np.max(pts[:,0])/img_w, np.max(pts[:,1])/img_h], dtype=np.float32)
    v1 = pts[5] - wrist
    v2 = pts[17] - wrist
    palm_n = np.cross(v1, v2)
    norm_palm = np.linalg.norm(palm_n)
    if norm_palm > 0:
        palm_n = palm_n / norm_palm
    else:
        palm_n = np.zeros(3, dtype=np.float32)
    fingertip_ids = [4,8,12,16,20]
    fingertip_dists = [np.linalg.norm(pts[i] - wrist) / hand_size for i in fingertip_ids]
    scalars = np.array([hull_area_norm, float(np.mean(fingertip_dists)), float(np.std(fingertip_dists))], dtype=np.float32)
    features = np.concatenate([norm_flat, dists, angs, palm_n.astype(np.float32), bbox, scalars]).astype(np.float32)
    return features

def aggregate_sequence_features(frames_features):
    arr = np.array(frames_features, dtype=np.float32)
    mean = arr.mean(axis=0)
    std = arr.std(axis=0)
    if arr.shape[0] > 1:
        mean_delta = np.diff(arr, axis=0).mean(axis=0)
    else:
        mean_delta = np.zeros_like(mean)
    agg = np.concatenate([mean, std, mean_delta]).astype(np.float32)
    return agg

# -------------------------
# Helpers to read/write embedded storage (self-modifying)
# -------------------------
def read_embedded_storage():
    global __DATA_STORAGE__
    return __DATA_STORAGE__

def write_embedded_storage(new_storage):
    script_path = Path(__file__).resolve()
    txt = script_path.read_text(encoding='utf-8')
    start_token = "# __DATA_STORAGE_START__"
    end_token = "# __DATA_STORAGE_END__"
    start = txt.find(start_token)
    end = txt.find(end_token)
    if start == -1 or end == -1:
        raise RuntimeError("Cannot find embedded storage tokens in the script.")
    pre = txt[:start + len(start_token)]
    post = txt[end:]
    j = json.dumps(new_storage, indent=2)
    # build replacement block with triple-single quotes safely
    replacement = "\n__DATA_STORAGE__ = json.loads(r'''\n" + j.replace("'''","\\'\\'\\'") + "\n''')\n"
    new_txt = pre + replacement + post
    script_path.write_text(new_txt, encoding='utf-8')
    globals()['__DATA_STORAGE__'] = new_storage

# -------------------------
# Capture (in-memory)
# -------------------------
def capture_samples_memory(sign_name, sign_mark, samples_to_take, status_callback=None):
    storage = read_embedded_storage()
    samples = storage.get("samples", {})
    previews = storage.get("previews", {})
    if sign_name not in samples:
        samples[sign_name] = []
    if sign_name not in previews:
        previews[sign_name] = []
    cap = cv2.VideoCapture(0, cv2.CAP_DSHOW if os.name=='nt' else 0)
    if not cap.isOpened():
        if status_callback: status_callback("Cannot open camera")
        messagebox.showerror("Camera", "Could not open webcam.")
        return
    saved = 0
    with mp_hands.Hands(max_num_hands=1, min_detection_confidence=0.6, min_tracking_confidence=0.6) as hands:
        try:
            while saved < samples_to_take:
                if status_callback:
                    status_callback(f"Preparing sample {saved+1}/{samples_to_take}")
                frames_feats = []
                preview_frame = None
                t0 = time.time()
                while len(frames_feats) < FRAMES_PER_SAMPLE and (time.time() - t0) < 12.0:
                    ret, frame = cap.read()
                    if not ret:
                        break
                    frame = cv2.flip(frame, 1)
                    h, w = frame.shape[:2]
                    rgb = cv2.cvtColor(frame, cv2.COLOR_BGR2RGB)
                    results = hands.process(rgb)
                    if results.multi_hand_landmarks:
                        lm = results.multi_hand_landmarks[0]
                        mp_drawing.draw_landmarks(frame, lm, mp_hands.HAND_CONNECTIONS)
                        pts = np.array([[p.x, p.y, p.z] for p in lm.landmark], dtype=np.float32)
                        feats = compute_frame_features(pts, w, h)
                        frames_feats.append(feats)
                        preview_frame = frame.copy()
                    cv2.putText(frame, f"{sign_name} ({sign_mark}) Sample {saved+1}/{samples_to_take} Frames {len(frames_feats)}/{FRAMES_PER_SAMPLE}", (10,30),
                                cv2.FONT_HERSHEY_SIMPLEX, 0.6, (200,255,200), 2)
                    cv2.imshow("Capture - press q to abort", frame)
                    if cv2.waitKey(FRAME_WAIT_MS) & 0xFF == ord('q'):
                        cap.release()
                        cv2.destroyAllWindows()
                        if status_callback: status_callback("Capture aborted")
                        return
                if len(frames_feats) >= max(1, FRAMES_PER_SAMPLE//2):
                    agg = aggregate_sequence_features(frames_feats)
                    b = io.BytesIO()
                    np.save(b, agg)
                    b.seek(0)
                    feat_bytes = b.read()
                    feat_b64 = base64.b64encode(feat_bytes).decode('ascii')
                    samples[sign_name].append({'mark': sign_mark, 'ts': int(time.time()*1000), 'feat': feat_b64})
                    if preview_frame is not None:
                        try:
                            rgb_prev = cv2.cvtColor(preview_frame, cv2.COLOR_BGR2RGB)
                            res = hands.process(rgb_prev)
                            if res.multi_hand_landmarks:
                                lm = res.multi_hand_landmarks[0]
                                pts_px = np.array([[p.x * preview_frame.shape[1], p.y * preview_frame.shape[0]] for p in lm.landmark])
                                x1 = int(max(0, pts_px[:,0].min() - 20))
                                y1 = int(max(0, pts_px[:,1].min() - 20))
                                x2 = int(min(preview_frame.shape[1], pts_px[:,0].max() + 20))
                                y2 = int(min(preview_frame.shape[0], pts_px[:,1].max() + 20))
                                crop = preview_frame[y1:y2, x1:x2]
                                if crop.size == 0:
                                    crop = preview_frame
                            else:
                                crop = preview_frame
                            is_success, buf = cv2.imencode('.png', crop)
                            if is_success:
                                preview_b64 = base64.b64encode(buf.tobytes()).decode('ascii')
                                previews[sign_name].append({'ts': int(time.time()*1000), 'img': preview_b64})
                        except Exception:
                            pass
                    saved += 1
                    if status_callback:
                        status_callback(f"Saved {saved}/{samples_to_take}")
                    time.sleep(0.12)
                else:
                    if status_callback:
                        status_callback("Too few valid frames  retrying")
                    time.sleep(0.25)
        finally:
            cap.release()
            cv2.destroyAllWindows()
    storage['samples'] = samples
    storage['previews'] = previews
    write_embedded_storage(storage)
    if status_callback:
        status_callback("Capture complete")
    messagebox.showinfo("Capture", f"Captured {saved} samples for '{sign_name}'.")

def dataset_summary_memory():
    storage = read_embedded_storage()
    rows = []
    samples = storage.get("samples", {})
    for name in sorted(samples.keys()):
        count = len(samples.get(name, []))
        last_ts = 0
        if count > 0:
            last_ts = max(s['ts'] for s in samples.get(name, []))
        rows.append((name, count, last_ts))
    return rows

def get_previews_for_sign(sign_name, limit=8):
    storage = read_embedded_storage()
    previews = storage.get("previews", {}).get(sign_name, [])
    previews = sorted(previews, key=lambda x: x.get('ts',0), reverse=True)
    return previews[:limit]

def load_all_features_from_memory():
    storage = read_embedded_storage()
    samples = storage.get("samples", {})
    X = []
    y = []
    for label, items in samples.items():
        for it in items:
            try:
                b = base64.b64decode(it['feat'])
                arr = np.load(io.BytesIO(b))
                X.append(arr)
                y.append(label)
            except Exception:
                continue
    if len(X) == 0:
        return np.array([]), np.array([])
    return np.vstack(X), np.array(y, dtype=object)

def train_model_memory(status_callback=None):
    X, y = load_all_features_from_memory()
    if X.size == 0:
        messagebox.showerror("Train", "No samples found in embedded storage.")
        if status_callback: status_callback("No data")
        return
    if status_callback: status_callback(f"Training on {len(X)} samples...")
    Xtr, Xte, ytr, yte = train_test_split(X, y, test_size=0.2, stratify=y, random_state=42)
    scaler = StandardScaler()
    Xtr_s = scaler.fit_transform(Xtr)
    Xte_s = scaler.transform(Xte)
    clf = RandomForestClassifier(n_estimators=200, n_jobs=-1, class_weight='balanced', random_state=42)
    clf.fit(Xtr_s, ytr)
    ypred = clf.predict(Xte_s)
    acc = accuracy_score(yte, ypred)
    report = classification_report(yte, ypred, zero_division=0)
    b = io.BytesIO()
    joblib.dump({'model': clf, 'scaler': scaler, 'labels': sorted(list(set(y)))}, b)
    b.seek(0)
    model_bytes = b.read()
    model_b64 = base64.b64encode(model_bytes).decode('ascii')
    storage = read_embedded_storage()
    storage['model'] = model_b64
    storage['labels'] = sorted(list(set(y)))
    write_embedded_storage(storage)
    if status_callback: status_callback(f"Training done  acc {acc:.3f}")
    messagebox.showinfo("Train finished", f"Test accuracy: {acc:.3f}\n\n{report}")

class MemoryRecognizer:
    def __init__(self):
        self.model = None
        self.scaler = None
        self.labels = None
        self.buffer = collections.deque(maxlen=FRAMES_WINDOW)
        self.running = False
        self.load_from_storage()

    def load_from_storage(self):
        storage = read_embedded_storage()
        model_b64 = storage.get('model', None)
        if not model_b64:
            self.model = None
            return
        try:
            model_bytes = base64.b64decode(model_b64)
            b = io.BytesIO(model_bytes)
            data = joblib.load(b)
            self.model = data['model']
            self.scaler = data['scaler']
            self.labels = data.get('labels', getattr(self.model, 'classes_', None))
        except Exception:
            self.model = None

    def start_recognition(self, status_callback=None):
        if self.model is None:
            messagebox.showerror("Recognize", "No trained model embedded. Train first.")
            if status_callback: status_callback("No model")
            return
        self.running = True
        cap = cv2.VideoCapture(0, cv2.CAP_DSHOW if os.name=='nt' else 0)
        if not cap.isOpened():
            messagebox.showerror("Camera", "Cannot open webcam.")
            return
        with mp_hands.Hands(max_num_hands=1, min_detection_confidence=0.55, min_tracking_confidence=0.55) as hands:
            last = ("...", 0.0)
            if status_callback: status_callback("Recognition running (q to stop)...")
            while self.running:
                ret, frame = cap.read()
                if not ret:
                    break
                frame = cv2.flip(frame, 1)
                h, w = frame.shape[:2]
                rgb = cv2.cvtColor(frame, cv2.COLOR_BGR2RGB)
                results = hands.process(rgb)
                if results.multi_hand_landmarks:
                    lm = results.multi_hand_landmarks[0]
                    mp_drawing.draw_landmarks(frame, lm, mp_hands.HAND_CONNECTIONS)
                    pts = np.array([[p.x, p.y, p.z] for p in lm.landmark], dtype=np.float32)
                    feats = compute_frame_features(pts, w, h)
                    self.buffer.append(feats)
                if len(self.buffer) == FRAMES_WINDOW:
                    agg = aggregate_sequence_features(list(self.buffer))
                    try:
                        agg_s = self.scaler.transform(agg.reshape(1,-1))
                        probs = self.model.predict_proba(agg_s)[0]
                        idx = int(probs.argmax())
                        label = self.model.classes_[idx] if hasattr(self.model, 'classes_') else self.labels[idx]
                        conf = float(probs[idx])
                        last = (label, conf)
                    except Exception:
                        last = ("err", 0.0)
                cv2.putText(frame, f"{last[0]} ({last[1]:.2f})", (10,40), cv2.FONT_HERSHEY_SIMPLEX, 1.0, (0,255,0), 2)
                cv2.imshow("Recognition - press q to stop", frame)
                if cv2.waitKey(FRAME_WAIT_MS) & 0xFF == ord('q'):
                    break
        cap.release()
        cv2.destroyAllWindows()
        self.running = False
        if status_callback: status_callback("Recognition stopped")

    def stop(self):
        self.running = False

class App:
    def __init__(self, root):
        self.root = root
        root.title("Self-contained Sign Tool")
        root.geometry("1000x700")
        self.bg = "#111216"
        self.fg = "#e6eef8"
        self.panel = "#1e1f22"
        root.configure(bg=self.bg)

        self.main = ttk.Frame(root)
        self.main.pack(fill=tk.BOTH, expand=True, padx=8, pady=8)

        self.nb = ttk.Notebook(self.main)
        self.nb.pack(fill=tk.BOTH, expand=True)

        self.tab_capture = ttk.Frame(self.nb)
        self.tab_train = ttk.Frame(self.nb)
        self.tab_recognize = ttk.Frame(self.nb)
        self.tab_dataset = ttk.Frame(self.nb)

        self.nb.add(self.tab_capture, text="Capture")
        self.nb.add(self.tab_train, text="Train")
        self.nb.add(self.tab_recognize, text="Recognize")
        self.nb.add(self.tab_dataset, text="Dataset")

        self.status_var = tk.StringVar(value="Ready")
        self.status = ttk.Label(root, textvariable=self.status_var, anchor="w", background=self.panel, foreground=self.fg)
        self.status.pack(side=tk.BOTTOM, fill=tk.X)

        self.recognizer = MemoryRecognizer()

        self._build_capture()
        self._build_train()
        self._build_recognize()
        self._build_dataset()

    def set_status(self, txt):
        self.status_var.set(txt)

    def _build_capture(self):
        f = self.tab_capture
        ttk.Label(f, text="Sign name:", background=self.bg, foreground=self.fg).grid(row=0, column=0, sticky="e", padx=6, pady=6)
        self.entry_name = ttk.Entry(f); self.entry_name.grid(row=0, column=1, padx=6, pady=6)
        ttk.Label(f, text="Short mark:", background=self.bg, foreground=self.fg).grid(row=1, column=0, sticky="e", padx=6, pady=6)
        self.entry_mark = ttk.Entry(f); self.entry_mark.grid(row=1, column=1, padx=6, pady=6)
        ttk.Label(f, text="Samples:", background=self.bg, foreground=self.fg).grid(row=2, column=0, sticky="e", padx=6, pady=6)
        self.spin_samples = tk.Spinbox(f, from_=3, to=300, width=6); self.spin_samples.delete(0,"end"); self.spin_samples.insert(0,str(DEFAULT_SAMPLES))
        self.spin_samples.grid(row=2, column=1, sticky="w", padx=6, pady=6)
        self.btn_capture = ttk.Button(f, text="Start Capture", command=self.on_capture)
        self.btn_capture.grid(row=3, column=0, columnspan=2, pady=10)
        self.lbl_cap = ttk.Label(f, text="Ready", background=self.bg, foreground=self.fg); self.lbl_cap.grid(row=4, column=0, columnspan=2)

    def on_capture(self):
        name = self.entry_name.get().strip()
        mark = self.entry_mark.get().strip()
        try:
            samples = int(self.spin_samples.get())
        except:
            samples = DEFAULT_SAMPLES
        if not name or not mark:
            messagebox.showerror("Capture", "Enter sign name and mark.")
            return
        self.btn_capture.config(state="disabled")
        def run():
            try:
                self.set_status("Capturing...")
                self.lbl_cap.config(text="Capturing...")
                capture_samples_memory(name, mark, samples, status_callback=self._cap_cb)
                self.set_status("Capture done")
            except Exception as e:
                messagebox.showerror("Capture error", str(e))
            finally:
                self.btn_capture.config(state="normal")
                self.refresh_dataset()
        threading.Thread(target=run, daemon=True).start()

    def _cap_cb(self, txt):
        self.lbl_cap.config(text=txt)
        self.set_status(txt)

    def _build_train(self):
        f = self.tab_train
        ttk.Label(f, text="Train model from embedded samples.", background=self.bg, foreground=self.fg).pack(anchor="w", padx=8, pady=8)
        self.btn_train = ttk.Button(f, text="Start Training", command=self.on_train); self.btn_train.pack(pady=8)
        self.lbl_train = ttk.Label(f, text="Ready", background=self.bg, foreground=self.fg); self.lbl_train.pack()

    def on_train(self):
        if not messagebox.askyesno("Train", "Start training?"):
            return
        self.btn_train.config(state="disabled")
        def run():
            try:
                self.set_status("Training...")
                self.lbl_train.config(text="Training...")
                train_model_memory(status_callback=self._train_cb)
                self.set_status("Training finished")
            except Exception as e:
                messagebox.showerror("Train error", str(e))
            finally:
                self.btn_train.config(state="normal")
                self.recognizer.load_from_storage()
                self.refresh_dataset()
        threading.Thread(target=run, daemon=True).start()

    def _train_cb(self, txt):
        self.lbl_train.config(text=txt)
        self.set_status(txt)

    def _build_recognize(self):
        f = self.tab_recognize
        ttk.Label(f, text="Realtime recognition (uses embedded model).", background=self.bg, foreground=self.fg).pack(anchor="w", padx=8, pady=6)
        frm = ttk.Frame(f); frm.pack(pady=8)
        self.btn_rec_start = ttk.Button(frm, text="Start Recognition", command=self.on_rec_start); self.btn_rec_start.grid(row=0, column=0, padx=6)
        self.btn_rec_stop = ttk.Button(frm, text="Stop", command=self.on_rec_stop); self.btn_rec_stop.grid(row=0, column=1, padx=6)
        self.lbl_rec = ttk.Label(f, text="Model: " + ("loaded" if read_embedded_storage().get('model') else "not found"), background=self.bg, foreground=self.fg); self.lbl_rec.pack(pady=6)

    def on_rec_start(self):
        self.btn_rec_start.config(state="disabled")
        def run():
            try:
                self.recognizer.load_from_storage()
                self.recognizer.start_recognition(status_callback=self._rec_cb)
            except Exception as e:
                messagebox.showerror("Recognize error", str(e))
            finally:
                self.btn_rec_start.config(state="normal")
                self.lbl_rec.config(text="Model: " + ("loaded" if read_embedded_storage().get('model') else "not found"))
        threading.Thread(target=run, daemon=True).start()

    def on_rec_stop(self):
        self.recognizer.stop()
        self.set_status("Requested recognition stop")

    def _rec_cb(self, txt):
        self.lbl_rec.config(text=txt)
        self.set_status(txt)

    def _build_dataset(self):
        f = self.tab_dataset
        f.columnconfigure(0, weight=0)
        f.columnconfigure(1, weight=1)
        left = ttk.Frame(f); left.grid(row=0, column=0, sticky="ns", padx=6, pady=6)
        right = ttk.Frame(f); right.grid(row=0, column=1, sticky="nsew", padx=6, pady=6)
        self.tree = ttk.Treeview(left, columns=("samples","modified"), show="headings", height=20)
        self.tree.heading("samples", text="Samples")
        self.tree.heading("modified", text="Last Modified")
        self.tree.column("samples", width=80, anchor="center")
        self.tree.column("modified", width=140, anchor="center")
        self.tree.pack(fill="both", expand=True)
        self.tree.bind("<<TreeviewSelect>>", self.on_tree_select)
        btnf = ttk.Frame(left); btnf.pack(fill="x", pady=6)
        ttk.Button(btnf, text="Refresh", command=self.refresh_dataset).pack(side="left", padx=4)
        ttk.Button(btnf, text="Delete Selected", command=self.on_delete).pack(side="left", padx=4)
        ttk.Button(btnf, text="Export Selected (.zip)", command=self.on_export).pack(side="left", padx=4)
        ttk.Label(right, text="Previews:", background=self.bg, foreground=self.fg).pack(anchor="nw")
        self.preview_area = ttk.Frame(right); self.preview_area.pack(fill="both", expand=True)
        self.thumb_labels = []
        self.thumb_images = []
        grid = ttk.Frame(self.preview_area); grid.pack(pady=6)
        for r in range(2):
            for c in range(4):
                lbl = ttk.Label(grid, text="(empty)", relief="ridge", width=18, anchor="center")
                lbl.grid(row=r, column=c, padx=6, pady=6)
                self.thumb_labels.append(lbl)
        self.lbl_info = ttk.Label(right, text="", background=self.bg, foreground=self.fg); self.lbl_info.pack(anchor="w", pady=4)
        self.refresh_dataset()

    def refresh_dataset(self):
        for i in self.tree.get_children():
            self.tree.delete(i)
        rows = dataset_summary_memory()
        for name, count, last_ts in rows:
            mstr = datetime.fromtimestamp(last_ts/1000).strftime("%Y-%m-%d %H:%M") if last_ts>0 else "-"
            self.tree.insert("", "end", iid=name, values=(count, mstr))
        self.set_status("Dataset refreshed")

    def on_tree_select(self, event):
        sel = self.tree.selection()
        if not sel:
            return
        name = sel[0]
        previews = get_previews_for_sign(name, limit=8)
        self.lbl_info.config(text=f"{name}  {len(previews)} previews")
        self.thumb_images = []
        for i, lbl in enumerate(self.thumb_labels):
            lbl.config(image="", text="(empty)")
        for idx, p in enumerate(previews):
            try:
                img_b = base64.b64decode(p['img'])
                if PIL_AVAILABLE:
                    img = Image.open(io.BytesIO(img_b))
                    img.thumbnail((160,110), Image.LANCZOS)
                    tkimg = ImageTk.PhotoImage(img)
                else:
                    arr = cv2.imdecode(np.frombuffer(img_b, np.uint8), cv2.IMREAD_COLOR)
                    if arr is None:
                        raise Exception("cv decode failed")
                    arr = cv2.cvtColor(arr, cv2.COLOR_BGR2RGB)
                    h,w = arr.shape[:2]
                    scale = min(160/w, 110/h, 1.0)
                    nw, nh = max(1,int(w*scale)), max(1,int(h*scale))
                    small = cv2.resize(arr, (nw, nh))
                    _, buf = cv2.imencode('.png', cv2.cvtColor(small, cv2.COLOR_RGB2BGR))
                    b64 = base64.b64encode(buf.tobytes()).decode('ascii')
                    tkimg = tk.PhotoImage(data=b64)
                self.thumb_images.append(tkimg)
                self.thumb_labels[idx].config(image=tkimg, text="")
            except Exception:
                self.thumb_labels[idx].config(text="(err)")

    def on_delete(self):
        sel = self.tree.selection()
        if not sel:
            messagebox.showinfo("Delete", "Select a sign to delete.")
            return
        name = sel[0]
        if not messagebox.askyesno("Delete", f"Delete embedded data for '{name}'?"):
            return
        storage = read_embedded_storage()
        storage['samples'].pop(name, None)
        storage['previews'].pop(name, None)
        write_embedded_storage(storage)
        self.refresh_dataset()

    def on_export(self):
        sel = self.tree.selection()
        if not sel:
            messagebox.showinfo("Export", "Select a sign first.")
            return
        name = sel[0]
        path = filedialog.asksaveasfilename(defaultextension=".zip", filetypes=[("Zip","*.zip")], initialfile=f"{name}.zip")
        if not path:
            return
        storage = read_embedded_storage()
        samples = storage.get('samples', {}).get(name, [])
        previews = storage.get('previews', {}).get(name, [])
        import zipfile
        with zipfile.ZipFile(path, "w") as z:
            for i, s in enumerate(samples):
                b = base64.b64decode(s['feat'])
                z.writestr(f"samples/{name}_{i}.npy", b)
            for i, p in enumerate(previews):
                b = base64.b64decode(p['img'])
                z.writestr(f"previews/{name}_{i}.png", b)
        messagebox.showinfo("Export", f"Exported {len(samples)} samples to {path}")

def main():
    root = tk.Tk()
    app = App(root)
    root.mainloop()

if __name__ == "__main__":
    main()
